import React from 'react'
import MenuItems from './MenuItems.js'
import './Navbar.css'

const Navbar = () => {
    return(
        <div className="Navbar">
            <label className="navbar-title">THE FALSE 9</label>
            <nav>
                <ul className="nav-links-list">
                    {MenuItems.map((item, index) => {return <li key={index}><a className={item.className} href={item.url}>{item.title.toUpperCase()}</a></li>;})}
                    <li><a><i className="fab fa-facebook"></i></a></li>
                </ul>
            </nav>
        </div>
    );
};

export default Navbar;
